const GetMobileNumber=(text)=>{
    var x =(text.match(/([+]?\d{1,2}?)?(\d{3}?){2}\d{5}/g,''))
    return(
      <div>
        <ul>
          {x.map(item=>{
            return <li>{item[0]}</li>
          })}
        </ul>
    </div>
    )
  }
  export default GetMobileNumber;
